import React, { Component } from 'react';
import TableRow from './TableRow';
export class returnflights extends Component {
  render() {
    let rows = [];

    //generate the table rows
    //based on container representational pattern and Hook, CountryTable should not have business logic
    this.props.data.forEach((dataObj) => {
      rows.push(
        <TableRow
          key={dataObj.flight_from}
          flight_from={dataObj.flight_to}
          flight_to={dataObj.flight_from}
          flightNum={dataObj.flightNum}
          flight_date={dataObj.flight_date}
          cabin={dataObj.cabin}
          noSeats={dataObj.noSeats} 
          depTime={dataObj.depTime} 
          arrTime={dataObj.arrTime} 
          terminal={dataObj.terminal}
          />);
    });

    return (
       <div>
      <table className='table table-striped' style={{ marginTop: 20 }}>
        <thead>
            <tr>
              <th>FROM</th>
              <th>TO</th>
              <th>FLIGHT NO.</th>
              <th>DATE</th>
              <th>CABIN</th>
              <th>AVAILABLE SEATS</th>
              <th>DEPARTURE TIME</th>
              <th>ARRIVAL</th>
              <th>TERMINAL</th>
            </tr>
          </thead>
        <tbody className='tableBodyStyle'>

          {rows}
        </tbody>
      </table>
      <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <NavLink className="nav-link" to="/returnflights">
                Book Return Flight
              </NavLink>
            </li>
          </ul>
       </div>



      // <div>
      //   <table className="table table-striped" style={{ marginTop: 20 }}>
      //     <thead>
      //       <tr>
      //         <th>FROM</th>
      //         <th>TO</th>
      //         <th>FLIGHT NO.</th>
      //         <th>DATE</th>
      //         <th>CABIN</th>
      //         <th>AVAILABLE SEATS</th>
      //         <th>DEPARTURE TIME</th>
      //         <th>ARRIVAL</th>
      //         <th>TERMINAL</th>
      //       </tr>
      //     </thead>
      //     <tbody>{this.recordList()}</tbody>
      //   </table>
      // </div>

    )
  }
}

export default returnflights
